import { stringParaEntradaDeData } from "../utils/converters";

export default class Evento {
    id: number | null;
    nome: string;
    data: string;
    tipo: string;
    status: string;

    constructor(id: number | null, nome: string, data: string,
        descricao: string, status: string) {
        this.id = id;
        this.nome = nome;
        this.data = data;
        this.tipo = descricao;
        this.status = status;
    }

    static geraEventosMock() {
        return [
            new Evento(1, "UPF em Dança",
            "10/11/2024",
            "Evento de dança",
            "PREVISTO",
          ),
          new Evento(2, "UPF na feitech",
            "10/11/2024",
            "Evento de tecnologia",
            "PREVISTO",
          )
        ]
      }


    static vazio(): Evento {
      return new Evento(null, "", stringParaEntradaDeData(""), "", "");
    }
}
